    Federal Account to the Nonfederal Account when it was discovered that a nonfederal
    campaign had used its credit card to purchase tickets to an event in February
    in spite of the fact that the website indicates that we do not accept credit cards
    from campaigns.  Because all credit card contributions go automatically into the
    federal account, the funds were deposited in the federal account.  This transfer
    moves the funds to the nonfederal account where they should have been deposited
    in the first place.\n"
